import React, { useState } from 'react'

function AddSynonym(props) {
    const [synonym, setSynonym] = useState('')
    return (
        <form onSubmit={(e) => {
            e.preventDefault();
            let obj = {
                entity: {
                    content: props.content,
                    synonyms: synonym
                },
                idEntity: props.entityId,
                idChildren: props.childrenId
            }

            props.handelSubmitSynonym(e, obj)
            e.currentTarget.reset()

        }} style={{ display: "inline-block" }}>

            <input className="addSyn" type="text" onChange={(e) => setSynonym(e.target.value)} placeholder="Add Synonym" required />

        </form>
    )
}

export default AddSynonym
